            val: "2" 
        },
        {
            val: "3" 
        },
]

export class Main extends React.Component{
    constructor(){
        super()

        this.state ={
            inputValue: 0,
        }
    }
    render(){
        return(
            <div className={css.containre}>
                <div className={css.result}>{this.state.inputValue}</div>
                {
                    data.map((el,id)=>{
                        return <button className={css.btn}>{el.val}</button>
                    })
                }
            </div>
        )
    }
}
